import { useCartContext } from "../cart_context";

const Cart = () => {
  // console.log(cart);
  const { cart } = useCartContext();
  console.log(cart);

  return (
    <>
      {cart.map((cur) => {
        return (
          <div>
            <h1>hello</h1>
          </div>
        );
      })}
      ;
    </>
  );
};

export default Cart;
